import java.util.ArrayList;

/**
 * Created by oisin on 12/3/16.
 */
public class Day2 {

    static final int[][] dialPad = {{1, 2, 3}, {4, 5, 6}, {7, 8, 9}};
    static int currentRow = 1, currentColumn = 1;
    static ArrayList<Integer> key = new ArrayList<>();

    final static String input = "\n" +
            "\n" +
            "\n" +
            "\n" +
            "";

    static void move(char direction) {
        switch (direction) {
            case 'U':
                currentRow -= 1;
                break;
            case 'D':
                currentRow += 1;
                break;
            case 'L':
                currentColumn -= 1;
                break;
            case 'R':
                currentColumn += 1;
                break;
        }
        if(currentColumn == -1) {
            currentColumn = 0;
        }
        if(currentColumn == 3) {
            currentColumn = 2;
        }
        if(currentRow == -1) {
            currentRow = 0;
        }
        if(currentRow == 3) {
            currentRow = 2;
        }
    }

    public static void main(String args[]) {
        String[] inputLines = input.split("\n");
        for(String inputLine : inputLines) {
            for(char command : inputLine.toCharArray()) {
                move(command);
            }
            key.add(dialPad[currentRow][currentColumn]);
        }
        for(int digit:key) {
            System.out.print(digit);
        }
    }
}
